import Input from "../components/input";

const About = (state) => {
    state ={
        value:'11112'
    }
    const fu =(data)=>{
        console.log(data);
        this.setState({
            value:data
        })
    }
    return (
        <div className="About">
            <Input fu={fu}/>
            {state.value}
        </div>
    );
}

export default About;
